@keyframes pseudoScroll {
  0% {
    opacity: 0;
    left: 30px;
  }
  50% {
    opacity: 1;
    left: 60px;
  }
  100% {
    opacity: 0;
    left: 90px;
  }
}

.pseudo-scroll {
  position: relative;
  padding: 0 25px;

  &__line,
  &__line-active {
    height: 4px;
    border-radius: 3px;
  }
  &__line {
    position: relative;
    background-color: #dde3eb;
    &-active {
      position: absolute;
      top: 0;
      left: 30px;
      width: 70px;
      background-color: $active;
      animation-name: pseudoScroll;
      animation-duration: 1.5s;
      animation-timing-function: ease-in-out;
      animation-iteration-count: infinite;
      animation-fill-mode: forwards;
    }
  }
  &__arrow {
    & svg {
      position: absolute;
      top: 50%;
      fill: #b2bdcc;
    }

    &.--prev svg {
      left: 0;
      transform: translateY(-50%) rotate(180deg);
    }
    &.--next svg {
      right: 0;
      transform: translateY(-50%);
    }
  }
}

